import {Container, NavDropdown, Nav, Form, FormControl, Button} from 'react-bootstrap';
import './navbar.css'

function Navbar (){
    return(
        
        <Navbar bg="dark" variant="dark">
        <Container>
          <Navbar.Brand href="#home">Navbar with text</Navbar.Brand>
          <Navbar.Toggle />
          <Navbar.Collapse className="justify-content-end">
            <Navbar.Text>
              Signed in as: <a href="#login">Mark Otto</a>
            </Navbar.Text>
          </Navbar.Collapse>
        </Container>
      </Navbar>
        
    );
}

export default Navbar;
